import React from "react";
import Container from "react-bootstrap/Container";
import Card from "react-bootstrap/Card";

const Cost = (props) => {
  const test = props.item.map((item, index) => (
    <li key={index}>
      {" "}
      {item.name} - {item.price}{" "}
    </li>
  ));

  return (
    <div>
      <Container
        style={{
          alignitems: "center",
          textAlign: "left",
          fontWeight: "bold",
          color: "black",
        }}
      >
        <Card>
          <Card.Body>
            {" "}
            <ul> {test} </ul>{" "}
          </Card.Body>
        </Card>
      </Container>
    </div>
  );
};

export default Cost;
